import { useEffect, useState } from 'react'

function useGetLoggedInUser() {
  console.log("useDisplayName")
    const [name, setName] = useState('name')

    useEffect(() => {
      const dataName = "davey"
      setName(dataName)
    }, []);

    return name
}

export default useGetLoggedInUser
